(function($) {
	function setupVideoBackgroundCovers()
	{
		$('.page-form-bg video, .app-cta-bg video').each(function() {
			var $win = $(window);
			var $video = $(this);
			var $container = $video.parent();

			var bgAR = 16 / 9;
			function sizeBg() {
				var containerW = $container.width();
				var containerH = $container.height();
				var containerAR = containerW / containerH;

				if (containerAR <= bgAR) {
					// w / h = ar -> 1 / 2 = 0.5 # get aspect ratio with known width and height
					// ar * h = w -> 0.5 * 2 = 1 # get width with known height and aspect ratio
					// w / ar = h -> 1 / 0.5 = 2 # get height with known width and aspect ratio

					$container.children().css({
						height: containerH + 'px',
						width: (bgAR * containerH) + 'px'
					});
				}
				else {
					$container.children().css({
						height: (containerW / bgAR) + 'px',
						width: containerW + 'px'
					});
				}

				$container.children().each(function() {
					var $this = $(this);
					$this.css({
						position:'absolute',
						left: Math.min(0, (containerW - $this.width()) / 2) + 'px',
						top: Math.min(0, (containerH - $this.height()) / 2) + 'px'
					});
				});
			}
			$win.resize(sizeBg);
			$win.on('orientationchange', sizeBg);
			sizeBg();
		});
	}

	$(document).ready(function() {
		setupVideoBackgroundCovers();
	});
})(jQuery);
