(function($) {
	$(window).load(function() {
		/**
		 * Lazy loading
		 *
		 * When an image is loaded, check if it's a placeholder for a video.
		 * If so, start loading the video.
		 *
		 * By default, videos will be autoplaying and looped, but NOT muted.
		 *
		 * You can add data attributes to your placeholder image to change this:
		 *   - data-autoplay="false"
		 *   - data-loop="false"
		 *   - data-muted="true"
		 */
		$('img.lazy').load(function() {
			var $img = $(this);
			var isMobileDevice = /Android|webOS|iPhone|iPad|iPod|BlackBerry|IEMobile|Opera Mini/i.test(navigator.userAgent);

			if($img.data('video') && !isMobileDevice) {
				var videoPlaceholder = $img.data('original');
				var videoURL = $img.data('video');

				var autoplay = $img.data('autoplay') === false ? '' : 'autoplay';
				var loop = $img.data('loop') === false ? '' : 'loop';
				var muted = $img.data('muted') === true ? 'muted' : '';

				var videoHTML = '<video width="2048" height="876" poster="' + videoPlaceholder + '" ' + autoplay + ' ' + loop + ' ' + muted + '>';
				videoHTML += '<source src="' + videoURL + '" type="video/mp4"></source>';
				videoHTML += '</video>';

				$img.replaceWith(videoHTML);
			}

			// Fix for IE/Edge not supporting object-fit
			if($('.no-objectfit').length > 0) {
				$('.page-header-bg > video,.page-header-bg > img').css('height', 'auto');
			}
		});
		$("img.lazy").lazyload({
			effect : "fadeIn",
			threshold : 500, //Load images 500px before they appear on the screen it should be far enough so the user will not see the page without the image
			skip_invisible: false,
			failure_limit : 10
		});
	});

})(jQuery);;